import React from "react";
import { mockUsers } from './mockUsers';

const user = mockUsers[0]; // Jon Snow

export default function Profile() {
  return (
    <div className="flex flex-col items-center justify-center min-h-[60vh] bg-[#181f1f] text-white">
      <div className="bg-[#232b3a] rounded-2xl shadow-lg p-8 w-full max-w-md flex flex-col items-center">
        <div className="w-24 h-24 rounded-full bg-[#28c76f] flex items-center justify-center text-4xl font-bold mb-4">
          {user.name.split(' ').map(n => n[0]).join('').toUpperCase()}
        </div>
        <div className="text-2xl font-bold mb-2">{user.name}</div>
        <div className="text-[#28c76f] text-lg mb-2">{user.email}</div>
        <div className="text-lg mb-2">Tokens: <span className="font-bold text-[#28c76f]">{user.tokens.toLocaleString()}</span></div>
        <div className="text-lg">Success Rate: <span className="font-bold text-[#28c76f]">{user.successRate}%</span></div>
      </div>
    </div>
  );
}
